import React from 'react';
import './NewArival.css';
const NewArival = () => {
    return (
        <div className="photo p-2">
                <h2 className="text-center mt-4">New Arrival</h2>
            
            <div>
         <img className="w-100" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSKrBNwmFW6ikOTY07jLqkSEHUI-CIwGsuGdw&usqp=CAU" alt="" />
            <img className="w-100"  src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT-PBJXzXm8dxoI9BtIfsXyU3VuvPg5nP1llQ&usqp=CAU" alt="" />
            <img className="w-100"  src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQi5kVWa0DTCfKTKzOJyU4Azn48UfeK-cS_3A&usqp=CAU" alt="" />
            <img className="w-100"  src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQsrMRv4g3fqRvtSHU59CvgGiKaMjW8iGK3BA&usqp=CAU" alt="" />
            <img className="w-100"  src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT_scF_VrFJAtKqDBdF2MT91Yu6Atlgy6iNeA&usqp=CAU" alt="" />
            <img className="w-100"  src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrVBpK_iJEGpMt5wtEzFv6ehm3Z3VWbVyjFA&usqp=CAU" alt="" />
            </div>
           
        </div>
    );
};

export default NewArival;
